public class InnerFlowSourceConnectorPropertiesFactory(Action<Humidifier.AppFlow.FlowTypes.SourceConnectorProperties> factoryAction = null) : SubResourceFactory<Humidifier.AppFlow.FlowTypes.SourceConnectorProperties>
{

    internal InnerFlowAmplitudeSourcePropertiesFactory AmplitudeFactory { get; set; }

    internal InnerFlowS3SourcePropertiesFactory S3Factory { get; set; }

    internal InnerFlowGoogleAnalyticsSourcePropertiesFactory GoogleAnalyticsFactory { get; set; }

    internal InnerFlowServiceNowSourcePropertiesFactory ServiceNowFactory { get; set; }

    internal InnerFlowCustomConnectorSourcePropertiesFactory CustomConnectorFactory { get; set; }

    internal InnerFlowSAPODataSourcePropertiesFactory SAPODataFactory { get; set; }

    internal InnerFlowPardotSourcePropertiesFactory PardotFactory { get; set; }

    internal InnerFlowVeevaSourcePropertiesFactory VeevaFactory { get; set; }

    internal InnerFlowTrendmicroSourcePropertiesFactory TrendmicroFactory { get; set; }

    internal InnerFlowDatadogSourcePropertiesFactory DatadogFactory { get; set; }

    internal InnerFlowMarketoSourcePropertiesFactory MarketoFactory { get; set; }

    internal InnerFlowSingularSourcePropertiesFactory SingularFactory { get; set; }

    internal InnerFlowSlackSourcePropertiesFactory SlackFactory { get; set; }

    internal InnerFlowDynatraceSourcePropertiesFactory DynatraceFactory { get; set; }

    internal InnerFlowZendeskSourcePropertiesFactory ZendeskFactory { get; set; }

    internal InnerFlowInforNexusSourcePropertiesFactory InforNexusFactory { get; set; }

    internal InnerFlowSalesforceSourcePropertiesFactory SalesforceFactory { get; set; }

    protected override Humidifier.AppFlow.FlowTypes.SourceConnectorProperties Create()
    {
        var sourceConnectorPropertiesResult = CreateSourceConnectorProperties();
        factoryAction?.Invoke(sourceConnectorPropertiesResult);

        return sourceConnectorPropertiesResult;
    }

    private Humidifier.AppFlow.FlowTypes.SourceConnectorProperties CreateSourceConnectorProperties()
    {
        var sourceConnectorPropertiesResult = new Humidifier.AppFlow.FlowTypes.SourceConnectorProperties();

        return sourceConnectorPropertiesResult;
    }
    public override void CreateChildren(Humidifier.AppFlow.FlowTypes.SourceConnectorProperties result)
    {
        base.CreateChildren(result);

        result.Amplitude ??= AmplitudeFactory?.Build();
        result.S3 ??= S3Factory?.Build();
        result.GoogleAnalytics ??= GoogleAnalyticsFactory?.Build();
        result.ServiceNow ??= ServiceNowFactory?.Build();
        result.CustomConnector ??= CustomConnectorFactory?.Build();
        result.SAPOData ??= SAPODataFactory?.Build();
        result.Pardot ??= PardotFactory?.Build();
        result.Veeva ??= VeevaFactory?.Build();
        result.Trendmicro ??= TrendmicroFactory?.Build();
        result.Datadog ??= DatadogFactory?.Build();
        result.Marketo ??= MarketoFactory?.Build();
        result.Singular ??= SingularFactory?.Build();
        result.Slack ??= SlackFactory?.Build();
        result.Dynatrace ??= DynatraceFactory?.Build();
        result.Zendesk ??= ZendeskFactory?.Build();
        result.InforNexus ??= InforNexusFactory?.Build();
        result.Salesforce ??= SalesforceFactory?.Build();
    }

} // End Of Class

